import React from 'react';

function FooterList({linkData, title}) {
  return (

    <div>
     <h3>{title}</h3>
      <nav>
        <ul>

        {
          linkData.map((link) =>  (
            <li key={link.id}>
              <a  href="#">{link.text} using {link.id}</a>
            </li>
      ))}
              </ul>
      </nav>
    </div>

)  // return ender

}
export default FooterList;
